// RentalDetails.js
import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function RentalDetails() {
  const { id } = useParams();
  const [rental, setRental] = useState(null);

  useEffect(() => {
    document.title = 'Rental Details';
    console.log("Fetching details for ID:", id);
    fetch(`http://127.0.0.1:8000/api/rentals/${id}/`)
      .then((response) => {
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        return response.json();
      })
      .then((data) => {
        console.log("Received data:", data);
        setRental(data);
      })
      .catch((error) => {
        console.error('Error fetching rental details:', error);
      });
  }, [id]);

  if (!rental) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <Navbar expand="lg" className="bg-body-tertiary" data-bs-theme="dark">
      <Container fluid>
          <Navbar.Brand href="http://localhost:3000">VehicleVerse</Navbar.Brand>
          <Navbar.Toggle aria-controls="vehicleverse" />
          <Navbar.Collapse id="vehicleverse">
            <Nav className="me-auto my-2 my-lg-0" style={{ maxHeight: '100px' }}>
              <Nav.Link href="http://localhost:3000">Home</Nav.Link>
              <Nav.Link href="http://localhost:3000/rental">Rent</Nav.Link>
              <NavDropdown title="POST" id="navbarScrollingDropdown">
                <NavDropdown.Item href="http://localhost:3000/sell/post">
                  ADD For Sell
                </NavDropdown.Item>
                <NavDropdown.Item href="http://localhost:3000/rent/post">
                  ADD For Rent
                </NavDropdown.Item>
              </NavDropdown>
            </Nav>
            <Button variant="danger" href="http://127.0.0.1:8000/login/">Log Out</Button>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Container className="mt-4">
        <h1 className="text-center">Rental Details</h1>
        <Row className="justify-content-md-center">
          <Col md={6}>
            <Card className="shadow">
              <Card.Img src={rental.image_link} alt="Rental" />
              <Card.Body>
                <Card.Title className="text-center mb-4">Vehicle Details</Card.Title>
                <div className="mb-3">
                  <strong>Vehicle Type:</strong> {rental.vehicle_type}
                </div>
                <div className="mb-3">
                  <strong>Phone Number:</strong> {rental.phone_number}
                </div>
                <div className="mb-3">
                  <strong>Model:</strong> {rental.model}
                </div>
                <div className="mb-3">
                  <strong>Price:</strong> {rental.price}
                </div>
                <div className="mb-3">
                  <strong>Description:</strong> {rental.description}
                </div>
                <div>
                  <strong>Availability:</strong>{' '}
                  <span style={{ color: rental.is_available ? 'green' : 'red' }}>
                    {rental.is_available ? 'Available' : 'Not Available'}
                  </span>
                </div>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default RentalDetails;
